  [],\n\t\"revision_timestamp\": \"2016-08-04T08:16:51.120579\",\n\t\"name\": \"kenai-national-moose-range-narrative-report-january-december-1964\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai NWR outlines
  Refuge accomplishments during the 1964 calendar year. The report begins by summarizing
  the weather conditions, habitat conditions, water conditions, and food and cover
  during this period. Wildlife- including migratory birds, big game animals, furbearers,
  predators, rodents, mammals, raptors, fish, and disease- is also covered. The Refuge
  development and maintenance section discusses physical developments, plantings,
  collections and receipts, and wildfires. Resource management is outlined; topics
  include fur harvesting, timber removal, and commercial fishing. A progress report
  on field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest and N-R forms and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
